import { useState } from "react";
import AuthContext, {useAuthStatusContext, useSetAuthStatusContext} from "./components/AuthContext";
import GoogleAuthSignIn from "./components/GoogleAuthSignIn";

function App() {
  const authStatus = useAuthStatusContext()
  console.log(authStatus)
  return (
    <div className="App">
      <AuthContext>
        {authStatus? (
          <h1>User Logged In</h1>
        ): (
          <GoogleAuthSignIn />
        )}
      </AuthContext>
    </div>
  );
}

export default App;
